import { app, BrowserWindow, ipcMain, nativeTheme, Tray, nativeImage, Menu, Notification } from 'electron';
import path from 'node:path';
import started from 'electron-squirrel-startup';
import * as fs from "node:fs";

// Handle creating/removing shortcuts on Windows when installing/uninstalling.
if (started) {
  app.quit();
}

// 应用程序图标
const icon = nativeImage.createFromDataURL('data:image/png;base64,');

const createWindow = () => {
  // Create the browser window.
  const mainWindow = new BrowserWindow({
    width: 1024,
    height: 768,
    webPreferences: {
      preload: path.join(__dirname, 'preload.js'),
    },
    autoHideMenuBar: true,
    center: true,
    icon: icon,
  });

  // 设置默认主题：亮色
  nativeTheme.themeSource = 'light';

  // and load the index.html of the app.
  if (MAIN_WINDOW_VITE_DEV_SERVER_URL) {
    // 本地开发环境
    mainWindow.loadURL(MAIN_WINDOW_VITE_DEV_SERVER_URL).then(() => {});
    // 打开开发工具
    mainWindow.webContents.openDevTools();
  } else {
    // 构建运行环境
    mainWindow.loadFile(path.join(__dirname, `../renderer/${MAIN_WINDOW_VITE_NAME}/index.html`)).then(() => {});
  }

  // 监听下载事件
  mainWindow.webContents.session.on('will-download', (event, item, webContents) => {
    // 设置文件保存位置后，界面就不再弹出对话框
    const savePath = path.join(app.getPath('downloads'), item.getFilename());
    item.setSavePath(savePath);

    item.on('updated', (event, state) => {
      if (state === 'progressing') {
        const num = Number((item.getReceivedBytes() / item.getTotalBytes()).toFixed(2));
        const progress = Number((num * 100).toFixed());
        webContents.send('download-progress', progress, item.getFilename());
        mainWindow.setProgressBar(num); // 设置下载进度值
      }
    });

    item.once('done', (event, state) => {
      if (state === 'completed') {
        webContents.send('download-complete', item.getSavePath());
        mainWindow.setProgressBar(-1); // 下载完成，隐藏进度条
        // 添加系统通知
        new Notification({ title: '下载完成', body: `文件保存至[ ${item.getSavePath()} ]`, icon: icon }).show();
      } else {
        webContents.send('download-failed');
        mainWindow.setProgressBar(0); // 下载失败，重置进度条
      }
    });

  });

  // 禁用默认滚动条
  mainWindow.webContents.on('dom-ready', () => {
      mainWindow.webContents.insertCSS(` ::-webkit-scrollbar { display: none; } `).then(() => {});
  });
};

// This method will be called when Electron has finished
// initialization and is ready to create browser windows.
// Some APIs can only be used after this event occurs.
app.whenReady().then(() => {
  createWindow();

  // macOS设置应用程序图标、Dock菜单
  if (process.platform === 'darwin') {
      app.dock.setIcon(icon);
      app.dock.setMenu(Menu.buildFromTemplate([
          { label: '打开新窗口', click: () => createWindow() }
      ]));
  }

  // 设置关于面板
  app.setAboutPanelOptions({
      applicationName: 'wei-app',
      applicationVersion: '1.0.0',
      authors: ['zhang weiwei'],
      copyright: '©2025 weiwei',
      version: '1.0.0',
      website: 'https://gitee.com/zww1990',
  });

  // 设置菜单栏为简体中文
  const appMenu = app.applicationMenu.items;
  const editSubMenu = appMenu[1].submenu.items;
  const viewSubMenu = appMenu[2].submenu.items;
  const winSubMenu = appMenu[3].submenu.items;
  const helpSubMenu = appMenu[4].submenu.items;
  Menu.setApplicationMenu(Menu.buildFromTemplate([
    {...appMenu[0], label: '文件', submenu: [
        {...appMenu[0].submenu.items[0], label: '退出'}
      ]},
    {...appMenu[1], label: '编辑', submenu: [
        {...editSubMenu[0], label: '撤消'},
        {...editSubMenu[1], label: '重做'},
        {...editSubMenu[2]},
        {...editSubMenu[3], label: '剪切'},
        {...editSubMenu[4], label: '复制'},
        {...editSubMenu[5], label: '粘贴'},
        {...editSubMenu[6], label: '删除'},
        {...editSubMenu[7]},
        {...editSubMenu[8], label: '全选'},
      ]},
    {...appMenu[2], label: '视图', submenu: [
        {...viewSubMenu[0], label: '重新加载'},
        {...viewSubMenu[1], label: '强制重新加载'},
        {...viewSubMenu[2], label: '切换开发人员工具'},
        {...viewSubMenu[3]},
        {...viewSubMenu[4], label: '实际尺寸'},
        {...viewSubMenu[5], label: '放大尺寸'},
        {...viewSubMenu[6], label: '缩小尺寸'},
        {...viewSubMenu[7]},
        {...viewSubMenu[8], label: '切换全屏'},
      ]},
    {...appMenu[3], label: '窗口', submenu: [
        {...winSubMenu[0], label: '最小化'},
        {...winSubMenu[1], label: '隐藏菜单栏'},
        {...winSubMenu[2], label: '关闭'},
      ]},
    {...appMenu[4], label: '帮助', submenu: [
        {...helpSubMenu[0], label: '了解更多'},
        {...helpSubMenu[1], label: '文档'},
        {...helpSubMenu[2], label: '社区讨论'},
        {...helpSubMenu[3], label: '提交反馈'},
        { type: 'separator' },
        { label: '关于', type: 'normal', role: 'about' },
      ]},
  ]));

  // 设置系统托盘
  const tray = new Tray(icon);
  tray.setToolTip('这是一款用来检查并下载最新版本JetBrains开发者工具的桌面应用程序');
  tray.setTitle('wei-app');
  const contextMenu = Menu.buildFromTemplate([
    { label: '关于', type: 'normal', role: 'about' },
    { label: '退出', type: 'normal', role: 'quit' },
  ]);
  tray.setContextMenu(contextMenu);
});

// On OS X it's common to re-create a window in the app when the
// dock icon is clicked and there are no other windows open.
app.on('activate', () => {
    if (BrowserWindow.getAllWindows().length === 0) {
        createWindow();
    }
});

// Quit when all windows are closed, except on macOS. There, it's common
// for applications and their menu bar to stay active until the user quits
// explicitly with Cmd + Q.
app.on('window-all-closed', () => {
  if (process.platform !== 'darwin') {
    app.quit();
  }
});

// In this file you can include the rest of your app's specific main process
// code. You can also put them in separate files and import them here.

// 监听渲染进程的请求
ipcMain.handle('read-file', async (event, fileName) => {
  const filePath = path.join(app.getPath('userData'), '/', fileName);
  try {
    const data = fs.readFileSync(filePath, 'utf-8');
    return JSON.parse(data);
  } catch (error) {
    console.error('Error reading file:', error);
    return [];
  }
});
ipcMain.handle('write-file', (event, fileName, fileContent) => {
  const filePath = path.join(app.getPath('userData'), '/', fileName);
  fs.writeFile(filePath, fileContent, 'utf-8', err => {
    if (err) {
      console.error('Error writing file:', err);
    } else {
      console.log('Writing file success.');
    }
  });
});
ipcMain.handle('dark-mode:toggle', () => {
  if (nativeTheme.shouldUseDarkColors) {
    nativeTheme.themeSource = 'light';
  } else {
    nativeTheme.themeSource = 'dark';
  }
  return nativeTheme.shouldUseDarkColors;
});
